import React, { useState, useEffect } from 'react';
import MediaService from './MediaService';

const MediaLister = () => {
    const [mediaList, setMediaList] = useState([]);
    const [filterName, setFilterName] = useState('');
    const [filterGenre, setFilterGenre] = useState('');
    const [filterRating, setFilterRating] = useState('');

    useEffect(() => {
        MediaService.getAllMedias()
            .then(response => setMediaList(response.data))
            .catch(error => console.error(error));
    }, []);

    const handleSort = (field) => {
        const sortedList = [...mediaList].sort((a, b) => a[field] > b[field] ? 1 : -1);
        setMediaList(sortedList);
    };

    return (
        <div className="list-page">
            <div className="header-row">
                <h2>Media List</h2>
                <button className="modify-button">Add New Media</button>
            </div>

            {/* Filter Inputs */}
            <div className="filter-container">
                <div className="filter-box">
                    <label className="filter-label">Name</label>
                    <input
                        type="text"
                        value={filterName}
                        onChange={(e) => setFilterName(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Name"
                    />
                    <button className="sort-button" onClick={() => handleSort('name')}>
                        Sort
                        <span className="sort-icon">⇅</span>
                    </button>
                </div>
                <div className="filter-box">
                    <label className="filter-label">Genre</label>
                    <input
                        type="text"
                        value={filterGenre}
                        onChange={(e) => setFilterGenre(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Genre"
                    />
                    <button className="sort-button" onClick={() => handleSort('genre')}>
                        Sort
                        <span className="sort-icon">⇅</span>
                    </button>
                </div>
                <div className="filter-box">
                    <label className="filter-label">Rating</label>
                    <input
                        type="text"
                        value={filterRating}
                        onChange={(e) => setFilterRating(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Rating"
                    />
                    <button className="sort-button" onClick={() => handleSort('rating')}>
                        Sort
                        <span className="sort-icon">⇅</span>
                    </button>
                </div>
            </div>

            {/* Media List Display */}
            <div className="table">
                {mediaList.filter(item =>
                    item.name.toLowerCase().includes(filterName.toLowerCase()) &&
                    item.genre.toLowerCase().includes(filterGenre.toLowerCase()) &&
                    (filterRating ? item.rating === parseInt(filterRating) : true)
                ).map(media => (
                    <div className="table-row" key={media.mediaId}>
                        <div className="form-field">{media.name}</div>
                        <div className="form-field">{media.genre}</div>
                        <div className="form-field">{media.rating}</div>
                        <div className="form-field">{media.stock}</div>
                        <div className="action-buttons">
                            <button className="modify-button">Modify</button>
                            <button className="delete-button">Delete</button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default MediaLister;
